import React, { Component } from "react";
import {
  Card,
  Button,
  CardText,
  CardBody,
  CardLink,
  CardTitle,
  CardSubtitle
} from "reactstrap";
import "./AccountData.css";

class AccountData extends Component {
  render() {
    return (
      <div className="card">
        <CardBody>
          <CardTitle>Welcome Michael</CardTitle>
        </CardBody>
        <CardText>Courses you are Enrolled In:</CardText>
        <img
          width="90%"
          src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180"
          alt="Card image cap"
        />
        <CardBody>
          <Button>Post it</Button>
        </CardBody>
      </div>
    );
  }
}

export default AccountData;
